    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Umatilla NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Umatilla NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, and information on the management direction.
    Key planning issues include: habitat and species management, waterfowl management,
    shorebirds, salmonids, islands, wildlife dependent uses, public use, and cultural
